import './Card.css'
import { motion } from "framer-motion"

export default function Resume() {
    return (
        <motion.div
        initial={{ opacity: 0 , x: -400}}
        animate={{opacity: 1, x:0 }}
        exit={{ opacity: 0, x: -400}}
        >
            <div className="Card">
                <div className="section">
                    <div><h2>Education</h2> <h2>Education</h2> </div>
                </div>
                <div className="section">
                    <h2>Education</h2>
                </div>
            </div>

        </motion.div>
    );
  }
